MATCH (p:Provider)-[:HAS_FILED]->(c:Claim)
WHERE EXISTS(c.departmentId)
RETURN c.departmentId, AVG(datetime(c.lastBilledDateP) - datetime(p.startDate)) AS averageTenure;

MATCH (e:Employee)-[:HIRED]->(h:Hiring)
WHERE h.startDate >= date(datetime().year + '-' + (datetime().month - 1) + '-' + datetime().day)
RETURN COUNT(e);

